// src/utils/audioUtils.js

export const versionedPath = (filename) => {
  // Define your version map here
  const versionMap = {
    '1': '1_v2',
    '2': '2_v2',
    '3': '3_v2',
    '4': '4_v2',
    '5': '5_v2',
    'chargeMonitor': 'chargeMonitor', // no version needed here unless you version it too
    'ventilate': 'ventilate',
    'stopCompression': 'stopCompression',
    'metronome': 'click', // your click.mp3 is called click.mp3
  };

  const mappedName = versionMap[filename] || filename;
  return `numbers/${mappedName}.mp3`;  // or remove `numbers/` if not used for all
};
